import "./PayrollAppBar.css"

import React, { Component } from 'react'

export default class PayrollAppBar extends Component {
  render() {
    return (
      <div>
      <AppBar className='title' EMPLOYEE PAYROLL>

          <div >
            EMPLOYEE PAYROLL
          </div>


      </AppBar>
      </div>
    )
  }
}
